import React from 'react'
import Article from '../Article'

const list = {
    'HOME': '', 
    'MOVIES': '',
    'SERIES': '',
    'GAMES': ''
}

export default function ListOfArticles(children) {
  return <div className="articles">
      {list.map(element => {
          return <Article children={element.key} />
      })}
  </div>
}
